import "./RadioButtons.css";

import Panel from "components/Panel/Panel";
import Input from "components/Input/Input";

const RadioButtons = () => {
  return (
    <Panel>
      <form>
        <div>
          <input type="radio" category="fruits" id="apple" value="Apple" name="Apple" checked/>
          <label for="apple">Apple</label>

          <input type="radio" category="fruits" id="apple" value="Apple" name="Apple"/>
          <label for="apple">Pear</label>

          <input type="radio" category="fruits" id="orange" value="Orange" name="Orange"/>
          <label for="orange">Orange</label>
        </div>
      </form>
    </Panel>
  )
};

export default RadioButtons;
